<!DOCTYPE html>
<html lang="en" xmlns:th="http://www.thymeleaf.org">
<head>
    <meta http-equiv="content-type" content="text/html; charset=UTF-8"/>
    <title>Down Under</title>
    <link rel="stylesheet" th:href="@{/css/index.css}">
<!--    <script type="text/javascript" src="../static/index.jsp" th:src="@{/static/index.jsp}" ;></script>-->
</head>
<body>

<div class="header">
    <H1>Down Under</H1>
</div>


<div class="info">
    <h2 th:text="${languageFilter.getHeading()}"></h2>
    <div class="lang">
        <form method="post" th:object="${languageFilter}" action="?lang">
            <label th:for="language" th:text="*{translateText('Select a Language: ')}"></label>
            <select th:field="*{language}">
                <option th:each="language : ${languages}"
                        th:text="${language.name}"
                        th:value="${language}"></option>
            </select>
            <input type="submit" value="Set language">
        </form>
    </div>
    <p th:text="${languageFilter.getWelcomeMessage()}"></p>
    <!--Region Start: File Upload-->
    <div class="image-upload">
        <form action="?image" enctype="multipart/form-data" method="post" th:object="${detectLandmark}">
            <label for="imageFile"
                   th:text="${languageFilter.translateText('Come, upload a beautiful image of where you want to go in Australia and we will tell you where it is!')}"></label>
            <input accept="image/*" id="imageFile" name="imageFile" type="file"/>
            <input type="submit" value="Upload"/>
        </form>
        <p th:text="*{detectLandmark.getImageLocationDescription()}"></p>
    </div>
    <!--Region End-->
</div>

<div id="NT" class="overlay">
    <div class="popup">
        <h2>Northern Territory</h2>
        <a class="close" href="">&times;</a>
        <div class="content">
            <p th:text=" ${northernTerritory.getDetails()}"></p>
            <img src="/img/Darwin.jpg" alt="Darwin" style="float:left;padding:0 20px 0 0;width:500px;height:250px;">

            <div class="month-chooser">
                <form method="post" th:object="${ntTravelInfo}" action="?nt">
                    <label th:for="travelMonth" th:text="${languageFilter.translateText('Select a Month: ')}"></label>
                    <select th:field="*{travelMonth}">
                        <option th:each="month : ${months}"
                                th:text="${month.name}"
                                th:value="${month}"></option>
                    </select>
                    <input type="submit" value="Show Info"/>
                </form>

            </div>

            <div class="travel-info" th:object="${northernTerritory}">
                <p th:text="*{travelInfo.showTravelInfo()}"></p>
            </div>

            <div class="year-chooser">
                <form action="?ntYear" method="post" th:object="${ntTravelInfo}">
                    <label th:for="travelYear" th:text="${languageFilter.translateText('Want to see how many visitors in a year? Select a year: ')}"></label>
                    <select th:field="*{travelYear}">
                        <option th:each="year : ${years}"
                                th:text="${year}"
                                id="year" th:value="${year}"></option>
                    </select>

                    <button id="show-year">Choose year</button>
                </form>


<!--                <div class="travel-info" th:object="${northernTerritory}">-->
<!--                    <p th:each="year: *{travelInfo.getYearlyList()}" id="yearlyList">-->

<!--                    </p>-->


<!--<div class="map-info">-->
<!--    <form>-->
<!--        <button id="show-chart"> Display graph</button>-->
<!--    </form>-->
                    <script th:inline="javascript">
                        /*<![CDATA[*/
                        var yearlyList = [[${yearlyList}]];


                        /*]]>*/
                    </script>
                <script src="https://www.gstatic.com/charts/loader.js" type="text/javascript"></script>
                <script type="text/javascript">
                    google.charts.load('current', {'packages':['corechart', 'bar']});
                    google.charts.setOnLoadCallback(drawStuff);
                    function drawStuff() {
                        var button = document.getElementById('show-chart');
                        var chartDiv = document.getElementById('chart_div');

                        var data = google.visualization.arrayToDataTable([
                            ['Months', 'Number visitors'],
                            ['01', parseInt(yearlyList[1])],
                            ['02', parseInt(yearlyList[2])],
                            ['03', parseInt(yearlyList[3])],
                            ['04', parseInt(yearlyList[4])],
                            ['05', parseInt(yearlyList[5])],
                            ['06', parseInt(yearlyList[6])],
                            ['07', parseInt(yearlyList[7])],
                            ['08', parseInt(yearlyList[8])],
                            ['09', parseInt(yearlyList[9])],
                            ['10', parseInt(yearlyList[10])],
                            ['11', parseInt(yearlyList[11])],
                            ['12', parseInt(yearlyList[12])]
                        ]);


                        var emptyOptions = {
                            width: 900,
                            chart: {
                                title: 'Total number of visitors in: ' + yearlyList[0],
                            },

                            series: {
                                0: { axis: 'distance' }, // Bind series 0 to an axis named 'distance'./ Bind series 1 to an axis named 'brightness'.
                            },
                            axes: {
                                y: {
                                    distance: {label: 'Number visitors'}, // Left y-axis.// Right y-axis.
                                }
                            }
                        };

                        // var yearlyOptions = {
                        //     width: 900,
                        //     chart: {
                        //         title: 'Total number of visifftors in: ' + yearlyList[0],
                        //     },
                        //     series: {
                        //         0: {targetAxisIndex: 0}
                        //     },
                        //     title: 'Total number of visitors in: ' + yearlyList[0],
                        //     axes: {
                        //         vAxes: {
                        //             // Adds titles to each axis.
                        //             0: {title: 'Total num visitors'}
                        //         },
                        //         hAxes: {
                        //             0: {title: 'Months'}
                        //         }
                        //     }
                        // };

                        function drawEmptyChart() {
                            var emptyChart = new google.charts.Bar(chartDiv);
                            emptyChart.draw(data, google.charts.Bar.convertOptions(emptyOptions));
                            button.onclick = drawEmptyChart;
                        }
                        // function drawYearlyChart() {
                        //     var yearlyChart = new google.visualization.ColumnChart(chartDiv);
                        //     yearlyChart.draw(data, google.charts.Bar.convertOptions(yearlyOptions));
                        //     button.onclick = drawYearlyChart;
                        // }

                        drawEmptyChart();
                    }

                </script>
                <div id="chart_div" style="width: 800px; height: 500px;"></div>
<!--</div>--> </div>
            </div>
        </div>
    </div>
